import React, { useState, useEffect } from "react";
import "./Dashboard.scss";
import { Chart as ChartJS, ArcElement, Tooltip, Legend, CategoryScale, LinearScale, BarElement, Title } from 'chart.js';
import { Pie, Bar } from 'react-chartjs-2';

// Registrar componentes do Chart.js
ChartJS.register(ArcElement, CategoryScale, LinearScale, BarElement, Title, Tooltip, Legend);

const Dashboard = () => {
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [equipesCount, setEquipesCount] = useState(0);
  const [inscricoesCount, setInscricoesCount] = useState(0);
  const [eventosCount, setEventosCount] = useState(0);
  const [usuariosCount, setUsuariosCount] = useState(0);
  const [eventosPorMes, setEventosPorMes] = useState([]);

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = async () => {
    try {
      const token = localStorage.getItem("token");
      
      // Buscar dados de equipes
      try {
        const equipesResponse = await fetch("http://localhost:5000/api/equipes", {
          headers: { Authorization: `Bearer ${token}` },
        });
        
        if (equipesResponse.ok) {
          const equipesData = await equipesResponse.json();
          setEquipesCount(equipesData.length || 0);
        } else {
          console.log("API de equipes não disponível, usando dados de exemplo");
          setEquipesCount(3); // Valor de exemplo
        }
      } catch (error) {
        console.log("Não foi possível buscar equipes, usando dados de exemplo");
        setEquipesCount(3); // Valor de exemplo quando API não está disponível
      }
      
      // Buscar dados de inscrições
      try {
        const inscricoesResponse = await fetch("http://localhost:5000/api/inscricoes/count", {
          headers: { Authorization: `Bearer ${token}` },
        });
        
        if (inscricoesResponse.ok) {
          const inscricoesData = await inscricoesResponse.json();
          setInscricoesCount(inscricoesData.count || 0);
        } else {
          console.log("API de inscrições não disponível, usando dados de exemplo");
          setInscricoesCount(12); // Valor de exemplo
        }
      } catch (error) {
        console.log("Não foi possível buscar contagem de inscrições, usando dados de exemplo");
        setInscricoesCount(12); // Valor de exemplo quando API não está disponível
      }
      
      // Dados de exemplo para eventos e usuários
      setEventosCount(8);
      setUsuariosCount(25);
      
      // Dados de exemplo para gráfico de eventos por mês
      setEventosPorMes([2, 4, 6, 5, 7, 8, 4, 3, 5, 6, 7, 9]);
      
    } catch (error) {
      console.error("Erro ao carregar dados do dashboard:", error);
      setError("Não foi possível carregar os dados do dashboard.");
      
      // Definir valores padrão em caso de erro
      setEquipesCount(3);
      setInscricoesCount(12);
      setEventosCount(8);
      setUsuariosCount(25);
      setEventosPorMes([2, 4, 6, 5, 7, 8, 4, 3, 5, 6, 7, 9]);
    } finally {
      setLoading(false);
    }
  };

  // Dados para o gráfico de pizza
  const pieData = {
    labels: ['Inscrições', 'Equipes', 'Eventos', 'Usuários'],
    datasets: [
      {
        data: [inscricoesCount, equipesCount, eventosCount, usuariosCount],
        backgroundColor: [
          'rgba(255, 99, 132, 0.7)',
          'rgba(54, 162, 235, 0.7)',
          'rgba(255, 206, 86, 0.7)',
          'rgba(75, 192, 192, 0.7)',
        ],
        borderColor: [
          'rgba(255, 99, 132, 1)',
          'rgba(54, 162, 235, 1)',
          'rgba(255, 206, 86, 1)',
          'rgba(75, 192, 192, 1)',
        ],
        borderWidth: 1,
      },
    ],
  };

  // Dados para o gráfico de barras de eventos por mês
  const barData = {
    labels: ['Jan', 'Fev', 'Mar', 'Abr', 'Mai', 'Jun', 'Jul', 'Ago', 'Set', 'Out', 'Nov', 'Dez'],
    datasets: [
      {
        label: 'Eventos por Mês',
        data: eventosPorMes,
        backgroundColor: 'rgba(255, 87, 34, 0.7)',
        borderColor: 'rgba(255, 87, 34, 1)',
        borderWidth: 1,
      },
    ],
  };

  const barOptions = {
    responsive: true,
    plugins: {
      legend: {
        position: 'top',
      },
      title: {
        display: true,
        text: 'Eventos por Mês',
      },
    },
  };

  if (loading) {
    return (
      <div className="dashboard-container loading">
        <div className="spinner"></div>
        <p>Carregando dados do dashboard...</p>
      </div>
    );
  }

  return (
    <div className="dashboard-container">
      <h2 className="dashboard-title">Dashboard</h2>
      
      {error && (
        <div className="error-message">
          <i className="fas fa-exclamation-triangle"></i>
          <p>{error}</p>
        </div>
      )}

      <div className="stats-grid">
        <div className="stat-card eventos">
          <div className="stat-icon">
            <i className="fas fa-calendar-alt"></i>
          </div>
          <div className="stat-info">
            <h3>Eventos</h3>
            <p className="stat-value">{eventosCount}</p>
          </div>
        </div>
        
        <div className="stat-card inscricoes">
          <div className="stat-icon">
            <i className="fas fa-ticket-alt"></i>
          </div>
          <div className="stat-info">
            <h3>Inscrições</h3>
            <p className="stat-value">{inscricoesCount}</p>
          </div>
        </div>
        
        <div className="stat-card equipes">
          <div className="stat-icon">
            <i className="fas fa-users"></i>
          </div>
          <div className="stat-info">
            <h3>Equipes</h3>
            <p className="stat-value">{equipesCount}</p>
          </div>
        </div>
        
        <div className="stat-card usuarios">
          <div className="stat-icon">
            <i className="fas fa-user"></i>
          </div>
          <div className="stat-info">
            <h3>Usuários</h3>
            <p className="stat-value">{usuariosCount}</p>
          </div>
        </div>
      </div>
      
      <div className="charts-container">
        <div className="chart-card">
          <h3 className="chart-title">Distribuição de Dados</h3>
          <div className="chart-wrapper pie">
            <Pie data={pieData} />
          </div>
        </div>
        
        <div className="chart-card">
          <h3 className="chart-title">Eventos por Mês</h3>
          <div className="chart-wrapper bar">
            <Bar data={barData} options={barOptions} />
          </div>
        </div>
      </div>
      
      <div className="recent-activities">
        <h3 className="section-title">Atividades Recentes</h3>
        <ul className="activity-list">
          <li className="activity-item">
            <div className="activity-icon">
              <i className="fas fa-plus-circle"></i>
            </div>
            <div className="activity-content">
              <p className="activity-text">Novo evento <strong>"Workshop de UX/UI"</strong> foi criado</p>
              <span className="activity-time">há 2 horas</span>
            </div>
          </li>
          <li className="activity-item">
            <div className="activity-icon">
              <i className="fas fa-user-plus"></i>
            </div>
            <div className="activity-content">
              <p className="activity-text"><strong>Carlos Santos</strong> se inscreveu em <strong>"Meetup de Programação"</strong></p>
              <span className="activity-time">há 5 horas</span>
            </div>
          </li>
          <li className="activity-item">
            <div className="activity-icon">
              <i className="fas fa-users"></i>
            </div>
            <div className="activity-content">
              <p className="activity-text">Nova equipe <strong>"Marketing Digital"</strong> foi criada</p>
              <span className="activity-time">há 1 dia</span>
            </div>
          </li>
        </ul>
      </div>
    </div>
  );
};

export default Dashboard;
